import React, { Component } from 'react';
import { Animated, StyleSheet, SafeAreaView, SectionList, Button, Alert, } from "react-native";

import { Text, View } from '../components/Themed';
import { RootTabScreenProps } from '../types';

import { Data } from '../data/FGList'
import { StatusBar } from 'expo-status-bar';

import { RectButton } from 'react-native-gesture-handler';
import Swipeable from 'react-native-gesture-handler/Swipeable';

const Item = ({ title }) => (
  <View style={styles.item}>
    <Text style={styles.title}>{title}</Text>
  </View>
);

// swipe
class AppleStyleSwipeableRow extends Component {
  renderLeftActions = (progress, dragX) => {
    const trans = dragX.interpolate({
      inputRange: [0, 50, 100, 101],
      outputRange: [-20, 0, 0, 1],
    });
    return (
      <RectButton style={styles.leftAction} onPress={this.close}>
        <Animated.Text
          style={[
            styles.actionText,
            {
              transform: [{ translateX: trans }],
            },
          ]}>
          Archive
        </Animated.Text>
      </RectButton>
    );
  };

  TabOneScreen = ({ navigation }: RootTabScreenProps<'TabOne'>) => (
    <SafeAreaView style={styles.container}>
      <SectionList
        sections={Data}
        keyExtractor={(item, index) => item + index}
        renderItem={({ item }) => <Item title={item} />}
        renderSectionHeader={({ section: { title } }) => (
          <Text style={styles.header}>{title}</Text>
        )}
      />
      <Swipeable renderLeftActions={this.renderLeftActions}></Swipeable>
      <Button
          title="Add food"
          color="#f194ff"
          onPress={() => Alert.alert('Recipe scanned! Food added.')}
      />
    </SafeAreaView>
  );
}

// Style
const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    paddingTop: StatusBar.currentHeight,
    marginHorizontal: 16
  },
  item: {
    backgroundColor: "#b5c4b1",
    padding: 20,
    marginVertical: 3
  },
  header: {
    fontSize: 25,
    backgroundColor: "#bfbfbf"
  },
  title: {
    fontSize: 12
  }
});

export default TabOneScreen;
